    <style>
        body {
            margin: 0;
            background: #f7f5f0;

            text-align: left;
            box-sizing: border-box;

            section { margin: 0 auto; }
        }

            padding: 0;
            position: relative;

        .i{ font-style: italic; }
        .u{ text-decoration: underline; }
        .s{ text-decoration: line-through; }
        .s, .sd{ text-decoration: line-through; }
